export interface ThaiAddress {
  district: string;
  amphoe: string;
  province: string;
  zipcode: number;
}

export function searchAddress(query: string, field?: 'district' | 'amphoe' | 'province' | 'zipcode', limit = 20): ThaiAddress[] {
  if (!query || query.length < 1) return [];
  const q = query.trim();
  const results: ThaiAddress[] = [];

  for (const [d, a, pi, z] of DATA) {
    if (results.length >= limit) break;
    const p = PROVINCES[pi];
    let match = false;
    if (!field || field === 'district') match = match || d.includes(q);
    if (!field || field === 'amphoe') match = match || a.includes(q);
    if (!field || field === 'province') match = match || p.includes(q);
    if (!field || field === 'zipcode') match = match || String(z).startsWith(q);
    if (match) results.push({ district: d, amphoe: a, province: p, zipcode: z });
  }
  return results;
}
